import React from 'react';

function Project({ heading, description, techStack, imageUrl }) {
  return (
    <div>
      <img src={imageUrl} alt={`${heading} image`} className="w-full h-40 object-cover rounded-md mb-4"/>
      <h3 className="text-2xl font-semibold mb-2">{heading}</h3>
      <p className="mb-4">{description}</p>
      <div className="flex flex-wrap">
        {techStack.map((tech, index) => (
          <span key={index} className="bg-gray-700 text-white text-xs font-semibold mr-2 mb-2 px-2.5 py-0.5 rounded">
            {tech}
          </span>
        ))}
      </div>
    </div>
  );
}

export default Project;
